import React, { Component } from "react";
import styled from "styled-components";
import { Col, Carousel } from "antd";

export class ProfileImage extends Component {
  render() {
    return (
      <Col span={8}>
        <Carousel autoplay>
            <div>
                <h3>1</h3>
            </div>
            <div>
                <h3>2</h3>
            </div>
            <div>
                <h3>3</h3>
            </div>
            <div>
                <h3>4</h3>
            </div>
        </Carousel>
      </Col>
    );
  }
}

export default ProfileImage;
